import React from 'react';
import GoogleLogin from 'react-google-login';
import {Grid,Paper} from '@material-ui/core';
import LockIcon from '@mui/icons-material/Lock';

function Logingoogle() {
    const paperStyle = {padding: 20,height:"70vh",width:280,margin:"20px auto"};
    const googleButtonStyle = {position: "absolute",top:"50%",left:"50%",transform: "translate(-50%, -50%)"};

    const responseGoogleSuccess = (response) => {
        console.log(response);
        console.log(response.profileObj);
        console.log(response.tokenObj.token_type); 
        console.log(response.accessToken);

    };
    const responseGoogleFailure = (response) => {
        console.log('Error while Sign-in Google ' + response);
        

    };
  

  return (
      <Grid>
         <Paper elevation={10} style={paperStyle}>
            <div style={googleButtonStyle}>
                <GoogleLogin
                    clientId="630997075895-jnr261ogegj9l1sqsu471g0a43srlcm9.apps.googleusercontent.com"
                    buttonText='Sign in with Google'
                    onSuccess={responseGoogleSuccess}
                    onFailure={responseGoogleFailure}
                    cookiePolicy={'single_host_origin'}
                />
            </div>
         </Paper>
      </Grid>
    
  )
}

export default Logingoogle
